  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Monomoy National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1963. The report begins by summarizing the weather conditions, habitat conditions,
  and water conditions during this period. Wildlife- including migratory birds, big
  game animals, furbearers, predators, rodents, raptors, fish, and disease- is also
  covered. The Refuge development and maintenance section discusses physical developments,
  plantings, and vegetation control. The public relations section of the report describes
  recreational uses, Refuge participation, hunting, and violations. Items of interest
  and N-R forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
